  let kolegij = upit.kolegij;
  // ... obično bi ovdje odredili koji je odgovor
  let odgovor = {
    upit, // vraćamo upit natrag, čisto za provjeru
    status: "uspješno",
  };
  res.json(odgovor);
}
function getingData(req, res) {
  //let upit = req.params;
